// SPDX-License-Identifier: MIT
pragma solidity ^0.8.20;

import "@openzeppelin/contracts/access/Ownable.sol";

contract FileSharing is Ownable {
    struct SharedFile {
        string fileHash;
        string fileName;
        uint256 fileSize;
        string fileType;
        address uploader;
        address[] sharedWith;
        bool isDeleted;
        uint256 version;
    }

    mapping(string => mapping(uint256 => SharedFile)) public files;
    mapping(address => string[]) public userFiles;
    mapping(address => string[]) public sharedWithUser;
    mapping(address => bool) public isAdmin;
    mapping(address => bool) public isBanned;
    mapping(string => uint256) public latestVersion;
    address[] public registeredUsers; // Track registered users

    event FileUploaded(string indexed fileHash, string fileName, uint256 fileSize, string fileType, address indexed uploader, uint256 version);
    event FileShared(string indexed fileHash, address indexed uploader, address indexed recipient);
    event FileDeleted(string indexed fileHash, address indexed uploader);
    event FileVersioned(string indexed fileName, string newHash, uint256 newVersion);
    event UserBanned(address indexed user, address indexed admin);
    event UserUnbanned(address indexed user, address indexed admin);

    constructor() Ownable(msg.sender) {
        isAdmin[msg.sender] = true;
    }

    modifier onlyUploaderOrAdmin(string memory _fileName, uint256 _version) {
        require(files[_fileName][_version].uploader == msg.sender || isAdmin[msg.sender], "Not authorized");
        _;
    }

    modifier notBanned() {
        require(!isBanned[msg.sender], "User is banned");
        _;
    }

    function uploadFile(string memory _fileHash, string memory _fileName, uint256 _fileSize, string memory _fileType) external notBanned {
        require(bytes(_fileHash).length > 0, "File hash cannot be empty");
        require(bytes(_fileName).length > 0, "File name cannot be empty");
        require(_fileSize > 0, "File size must be greater than 0");

        if (userFiles[msg.sender].length == 0) {
            registeredUsers.push(msg.sender);
        }

        uint256 newVersion = latestVersion[_fileName] + 1;
        files[_fileName][newVersion] = SharedFile({
            fileHash: _fileHash,
            fileName: _fileName,
            fileSize: _fileSize,
            fileType: _fileType,
            uploader: msg.sender,
            sharedWith: new address[](0),
            isDeleted: false,
            version: newVersion
        });
        latestVersion[_fileName] = newVersion;
        userFiles[msg.sender].push(_fileHash);
        emit FileUploaded(_fileHash, _fileName, _fileSize, _fileType, msg.sender, newVersion);
    }

    function shareFile(string memory _fileHash, address _recipient) external notBanned {
        require(bytes(_fileHash).length > 0, "File hash cannot be empty");
        require(_recipient != address(0), "Invalid recipient address");
        for (uint256 i = 1; i <= latestVersion[files[_fileHash][i].fileName]; i++) {
            if (keccak256(abi.encodePacked(files[files[_fileHash][i].fileName][i].fileHash)) == keccak256(abi.encodePacked(_fileHash)) && !files[files[_fileHash][i].fileName][i].isDeleted) {
                require(files[files[_fileHash][i].fileName][i].uploader == msg.sender, "You are not the owner");
                files[files[_fileHash][i].fileName][i].sharedWith.push(_recipient);
                sharedWithUser[_recipient].push(_fileHash);
                emit FileShared(_fileHash, msg.sender, _recipient);
                return;
            }
        }
        revert("File not found or deleted");
    }

    function deleteFile(string memory _fileName, uint256 _version) external onlyUploaderOrAdmin(_fileName, _version) {
        require(!files[_fileName][_version].isDeleted, "File already deleted");
        files[_fileName][_version].isDeleted = true;
        emit FileDeleted(files[_fileName][_version].fileHash, msg.sender);
    }

    function banUser(address _user) external onlyOwner {
        require(_user != address(0), "Invalid user address");
        require(!isBanned[_user], "User already banned");
        isBanned[_user] = true;
        emit UserBanned(_user, msg.sender);
    }

    function unbanUser(address _user) external onlyOwner {
        require(_user != address(0), "Invalid user address");
        require(isBanned[_user], "User not banned");
        isBanned[_user] = false;
        emit UserUnbanned(_user, msg.sender);
    }

    function getUserFiles(address _user) external view returns (SharedFile[] memory) {
        string[] memory fileHashes = userFiles[_user];
        SharedFile[] memory result = new SharedFile[](fileHashes.length);
        uint256 validCount = 0;
        for (uint256 i = 0; i < fileHashes.length; i++) {
            for (uint256 v = 1; v <= latestVersion[files[fileHashes[i]][v].fileName]; v++) {
                if (!files[files[fileHashes[i]][v].fileName][v].isDeleted) {
                    result[validCount] = files[files[fileHashes[i]][v].fileName][v];
                    validCount++;
                }
            }
        }
        assembly { mstore(result, validCount) }
        return result;
    }

    function getSharedFiles() external view returns (SharedFile[] memory) {
        string[] memory fileHashes = sharedWithUser[msg.sender];
        SharedFile[] memory result = new SharedFile[](fileHashes.length);
        uint256 validCount = 0;
        for (uint256 i = 0; i < fileHashes.length; i++) {
            for (uint256 v = 1; v <= latestVersion[files[fileHashes[i]][v].fileName]; v++) {
                if (!files[files[fileHashes[i]][v].fileName][v].isDeleted) {
                    result[validCount] = files[files[fileHashes[i]][v].fileName][v];
                    validCount++;
                }
            }
        }
        assembly { mstore(result, validCount) }
        return result;
    }

    function getAllFiles() external view onlyOwner returns (SharedFile[] memory) {
        uint256 totalFiles = 0;
        for (uint256 i = 0; i < registeredUsers.length; i++) {
            totalFiles += userFiles[registeredUsers[i]].length;
        }
        SharedFile[] memory result = new SharedFile[](totalFiles);
        uint256 index = 0;
        for (uint256 i = 0; i < registeredUsers.length; i++) {
            address user = registeredUsers[i];
            string[] memory hashes = userFiles[user];
            for (uint256 h = 0; h < hashes.length; h++) {
                for (uint256 v = 1; v <= latestVersion[hashes[h]]; v++) {
                    if (!files[hashes[h]][v].isDeleted) {
                        result[index] = files[hashes[h]][v];
                        index++;
                    }
                }
            }
        }
        assembly { mstore(result, index) }
        return result;
    }
}

